import {BrowserRouter, Routes, Route} from "react-router-dom";


import { Products } from "./pages/Products/Products";
import { ProductsTopAsc } from './pages/Products/ProductsTopAsc';
import NoPage from "./pages/NoPage";
import Contact
 from "./pages/Contact";
 import About
  from "./pages/About/About";
import NavBar from "./components/NavBar";
// import Footer from "./components/Footer";
import { ProductsTopDesc } from "./pages/Products/ProductsTopsDesc";
import  Home from "./pages/Home";
import { ProductsBottomsAsc } from "./pages/Products/ProductsBottomsAsc";
import { ProductsDressesAsc } from "./pages/Products/ProductsDressesAsc";
import { ProductsAsc } from "./pages/Products/ProductsAsc";
import { ProductsDesc } from "./pages/Products/ProductsDesc";


function App() {
  return (
    <BrowserRouter>
    <div className="App" id=".background-img">
      <nav><NavBar/></nav>
    <Routes>
    <Route path="/" element={<Home />}/>

      {/* <Route path="/home" element={<Home />}/> */}
      <Route path="/shop/asc" element={<ProductsAsc/>}/>
      <Route path="/shop" element={<Products/>}/>
      <Route path="/shop/desc" element={<ProductsDesc/>}/>
      <Route path="/shop/ProductsTopAsc" element={<ProductsTopAsc/>}/>
      <Route path="/shop/ProductsTopDesc" element={<ProductsTopDesc/>}/>
      <Route path="/shop/ProductsBottomsAsc" element={<ProductsBottomsAsc/>}/>
      <Route path="/shop/ProductsDressesAsc" element={<ProductsDressesAsc/>}/>
       <Route path="*" element={<NoPage />} />
       <Route path="/contact" element={<Contact/>}/>
       <Route path="/about" element={<About/>}/>
    </Routes>
    {/* <footer> <Footer/> </footer> */}
    </div>
  </BrowserRouter>
  );
}

export default App;
